import React from 'react'
import csclublogo from '../csclub_logo.png';
import { Tab } from "../Components/Tab"

function Header (props){

    const tabs = props.tabs;
    let tabsArray = [];

    if (props.clicked === true){
        tabs.forEach(element => {
            let modified = element;
            if (element === props.activeTag){
                modified = "< " + element + " />";
            }
            tabsArray.push(<Tab clicked={props.clicked}
                                    setClicked={props.setClicked} 
                                    activeTag={props.activeTag} 
                                    setActiveTag={props.setActiveTag} 
                                    text={modified}/>);
        });
    }
    else {
        tabs.forEach(element => {
            tabsArray.push(<Tab clicked={props.clicked}
                                    setClicked={props.setClicked} 
                                    activeTag={props.activeTag} 
                                    setActiveTag={props.setActiveTag} 
                                    text={element}/>);
        });
    }


    return (
       <header>
           <div className="flex justify-between items-center py-4 bg-blue-900">
            <img src={csclublogo} alt="Logo" width="85px" height="85px" className="justify-start px-6 py-6" onClick={() => props.setClicked(!props.clicked)}/>
            {tabsArray}
           </div>
       </header> 
    )
}

export default Header
